import React, { useState, useEffect } from 'react';
import {
    TextField,
    Button,
    Container,
    Typography,
    Grid,
    Select,
    MenuItem,
    InputLabel,
    FormControl,
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
} from '@mui/material';

const RegistrationForm = () => {
    const [formData, setFormData] = useState({
        nome_completo: '',
        sexo: '',
        email: '',
        celular: '',
        exames: '', // Novo campo para os exames
    });

    const [showWelcomeMessage, setShowWelcomeMessage] = useState(true);
    const [patientData, setPatientData] = useState(null);  // Add this line to declare patientData state
    const [examesOptions, setExamesOptions] = useState([]); // Lista de opções de exames

    useEffect(() => {
        // Carrega a lista de exames ao montar o componente
        fetchExamesList();
    }, []);

    const fetchExamesList = async () => {
        try {
            const response = await fetch('http://127.0.0.1:8000/api/exames');
            if (response.ok) {
                const examesData = await response.json();
                // Apenas os códigos dos exames são necessários para a API
                const examesOptions = examesData.map(exame => exame.codigo);
                setExamesOptions(examesOptions);
            } else {
                console.error('Failed to fetch exames list');
                // Handle the error, e.g., display an error message to the user
            }
        } catch (error) {
            console.error('Error fetching exames list:', error);
            // Handle error
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch('http://127.0.0.1:8000/api/cadastrar-paciente', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                const responseData = await response.json();
                console.log('Patient registered successfully:', responseData);

                const { numero_atendimento } = responseData;
                const patientResponse = await fetch(`http://127.0.0.1:8000/api/pacientes/${numero_atendimento}`);
                const patientData = await patientResponse.json();
                setPatientData(patientData);
            } else {
                console.error('Failed to register patient');
                // Handle the error, e.g., display an error message to the user
            }
        } catch (error) {
            console.error('Error:', error);
            // Handle error
        }
    };

    const handleWelcomeMessageClose = () => {
        setShowWelcomeMessage(false);
    };

    return (
        <Container maxWidth="sm">
            <Dialog open={showWelcomeMessage} onClose={handleWelcomeMessageClose}>
                <DialogTitle>Bem-vindo admin</DialogTitle>
                <DialogContent>
                    <Typography>
                        Você está no perfil de administrador. Você tem todas as permissões para criar pacientes, registros e puxar relatórios
                    </Typography>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleWelcomeMessageClose} color="primary">
                        Ok
                    </Button>
                </DialogActions>
            </Dialog>
            {patientData ? (
                // Render patient data after successful registration
                <div>
                    <Typography variant="h5">Relatório do Paciente</Typography>
                    <Typography>Nome: {patientData.nome_completo}</Typography>
                    <Typography>Gênero: {patientData.sexo}</Typography>
                    <Typography>Email: {patientData.email}</Typography>
                    <Typography>Celular: {patientData.celular}</Typography>
                    <Typography>Exames: {patientData.exames}</Typography>
                </div>
            ) : (
                <form onSubmit={handleSubmit}>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Nome Completo"
                                name="nome_completo"
                                value={formData.nome_completo}
                                onChange={handleInputChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <FormControl fullWidth>
                                <InputLabel>Gênero</InputLabel>
                                <Select
                                    name="sexo"
                                    value={formData.sexo}
                                    onChange={handleInputChange}
                                    label="Gênero"
                                >
                                    <MenuItem value="">Selecione o seu Gênero</MenuItem>
                                    <MenuItem value="M">Masculino</MenuItem>
                                    <MenuItem value="F">Feminino</MenuItem>
                                    <MenuItem value="O">Outro</MenuItem>
                                </Select>
                            </FormControl>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Email"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Celular"
                                name="celular"
                                value={formData.celular}
                                onChange={handleInputChange}
                            />
                        </Grid>

                                    <Grid item xs={12}>
                <FormControl fullWidth>
                    <InputLabel>Exames a serem realizados</InputLabel>
                    <Select
                        name="exames"
                        value={formData.exames}
                        onChange={handleInputChange}
                        label="Exames a serem realizados"
                    >
                        <MenuItem value="">Selecione os exames</MenuItem>
                        {examesOptions.map((exameOption) => (
                            <MenuItem key={exameOption} value={exameOption}>
                                {exameOption}
                            </MenuItem>
                        ))}
                    </Select>
                </FormControl>
            </Grid>
                    </Grid>
                    <Button type="submit" variant="contained" color="primary" style={{ marginTop: '20px' }}>
                        Cadastrar paciente
                    </Button>
                </form>
            )}
        </Container>
    );
};

export default RegistrationForm;
